// pages가 next에서 사용하는 라우터 폴더, _app.js는 next에서 제공하는 공통부분(Layout)
// Component를 props로 받는데 pages에 있는 component들
import React from 'react';
import AppLayout from '../components/AppLayout';
import Head from 'next/head';
import PropTypes from 'prop-types'; // 부모로부터 prop을 잘 받았는지 확인하는거

const NodeBird = ({ Component }) => {
    return (
        <>
            <Head>
                <title>NodeBird</title>
                <link rel="stylesheet" href="https://cdnjs.cloudflare.com/ajax/libs/antd/3.16.2/antd.css"/>
            </Head>
            <AppLayout>
                <Component/>
            </AppLayout>
        </>
    );
};

NodeBird.prototype = {
    Component: PropTypes.elementType, // elementType이 아닌걸 받으면 콘솔에 error을 띄운다
};

export default NodeBird
